        "answer": "Case: The client reaches out and asks us whether the maid he selected is pregnant before she joins him.Canned: Yes, she is. All our maids received their medical certificates from the government before we issued their visas. Also, all newly hired maids receive a routine medical checkup upon arrival by our certified nurses. We check for medical problems such as diabetes, asthma, hypertension, allergies, and blood pressure and we give random pregnancy tests.",
