    {
        "answer": "What if I cancel in the middle of the month?Canned: You can cancel your contract at any time and for whatever reason. There are no cancellation charges and no notice period is required. But please note that we don\u2019t issue partial refunds for any reason. I encourage you to keep your maid or replace her until the last day of the month to avoid wasting your remaining days of service.If they client escalated that the contract does not clarify that we do not have partial refund:Canned: Thank you for your feedback @Client Name@. We really try to make it as clear as possible that we don\u2019t issue any partial refunds for any reason. We state this in the receipt you receive from us every month for each payment.If the client escalated and threatened to go legally:Canned: Mr. John, after speaking to our management, we decided to refund you the remaining days of service based on the daily rate set by the ministry which is (AED 200 + VAT)/day.\u00a0Client escalated\u00a0Canned: I understand @client name@, I\u2019ll request an immediate refund for the days you\u2019ve paid for without a maid.\u00a0",
