    {
        "answer": "Case 1: The client\u2019s contract end date is today and asking to keep the maid till tomorrow morning.Canned: Sure Mr. X. Just please make sure that your maid comes back to our accommodation tomorrow before 9 am to avoid any additional charges. I\u2019ll reschedule your maid\u2019s Uber for tomorrow at 8:30 am.Case 2: If the client scheduled the contract for termination on 30/11/2021Canned: on the day of a cancellation our system generates a work order to send the maid an uber to pick her up. please reach us on the 30/11 morning to amend the date to 1/12/2021. We would like to draw your attention that she needs to be back before 8:30 AM to avoid any deduction.Case 3: Taxi work order delays. Note: If the logistic team updates us that no taxis are there at the client\u2019s address or in some cases when the Careem app is down, no need to escalate this but ask the client to book the maid a taxi and pay for it, he can send us the receipt to refund him. Canned: Unfortunately, we\u2019re unable to find any drivers that are close to your home. Would you be able to please send your maid by taxi? You can share the receipt with us after the ride is done so we can refund it to you.",
