        "answer": "Canned: We\u2019re glad you\u2019d like to keep your service @Client Name@. To undo your cancellation, please do the following:Go to the notification tab in your app (it\u2019s the tab that\u2019s right next to the homepage tab at the bottom of your app).Find the notification that you received after you requested to cancel your service. That notification should have an \u201cUndo Cancellation\u201d button. Please click that button and your service will continue normally.\u00a0",
