        "answer": "Case 1: Contract Got canceled due to not Signing Bank Direct Debits.Case 2: Client wants to pay and reactivate his contract Both cases are handled by the Retention team. Canned: We are sorry for this inconvenience, for agreements-related requestsplease call us by clicking on this link: https://www.maids.cc/client-relations-call -If the client doesn\u2019t want to call us:Action: Add a private note and transfer to Retention.",
