        "answer": "Client requesting to switch to MV with his CC maid: Contract period &lt; 6 months.Canned: Sure @client name@. For agreement-related requests please call us by clicking on this link: https://www.maids.cc/client-relations-call 1.1. If the client refused to call and asked for us to call insteadAction: Transfer to skill \u201cClient Retention Supervisors\u201dClient requesting to switch to MV with his CC maid: Contract period = or &gt; 6 months.\nBased on this formula, we can calculate the amount the client is saving when switching to MV:Monthly payment - 700 - @Maid salary@= Saved amount*Note: the 700 was calculated based on (10K + VAT / 24Month) + (250 + VAT)Example: cc client paying AED 4300, and his maid\u2019s salary is 2000 AED, so the calculation will be: 4300 - 700 - 2000 = AED 1600\u00a0\nCanned: Since you have completed 6 months, the price can drop by AED @amount@\u00a0 if you\u2019re sure you want to keep your maid for good. You can give up free replacements and secure your maid at the rate of AED 250/month + maid\u2019s salary for a one-time fee of AED 10,000. The price includes:2-year residency visa + health insurance.24/7 client support.Personalized Maids.cc app.\u00a0\u00a0Company doctor for your maid.\u00a0\u00a0Emirates ID, Medical, ATM card.The maid stays on our visa, so no paperwork is required.End of service dues.The maid stays on our visa, so no paperwork is required.\u00a0\u00a0NOTE: We don\u2019t offer MV option to GCC clients, so make sure to check the nationality before you send the canned response to the client\u00a02.1. Client accepted the offer/wants to discuss it furtherAdd a private note and transfer the chat to skill \u201cClient Retention Supervisor\u201d2.2. Client rejected the offer/will reach us later to discuss itCanned: Sure @client name@, let me know if you have any further questions or concerns.\u00a02.3. Client asks how did we calculate the price drop exactly?3.1. The client asked how did we calculate the price difference/month Filipina\u00a0Canned: You'll be paying AED 10,000 for two years, which works out to AED 416/ month. In addition to that, you'll also need to pay AED 250/month, as well as your maid's salary of AED 2,000 per month. This means that your total monthly expenditure will come to AED 2,666 instead of the previously mentioned AED@CC client monthly payment@&quot;\u00a03.2. The client asked how did we calculate the price difference/month Africans and Ethiopians\u00a0Canned: You'll be paying AED 10,000 for two years, which works out to AED 416/month. In addition to that, you'll also need to pay AED 250 per month, as well as your maid's salary of AED @maid\u2019s salary@ per month. This means that your total monthly expenditure will come to AED @amount@ instead of the previously mentioned AED@CC client monthly payment@&quot; 2.4. GCC clients:2.4.1. GCC says it says on the website we offer a discount after 6 monthsCanned: Thank you for bringing this typo on our website to our attention. I will immediately notify the responsible team to rectify the issue.\u00a02.4.2. Client argues and insists on getting the offer:Action: Transfer to Supervisors, so they can check with the management\u00a0",
