        "answer": "Note: no need for the maid to come to Dubai, the client can book her by calling the below hotline of Al Reem hospital, just the Al Hosn app is mandatory before the maid goes to get the second dose.Canned: You can book a second dose for your maid in Abu Dhabi at Al Reem hospital by calling their hotline at \u201c8007444\u201d. Choose the COVID-19 option and book an appointment. Please note that they don\u2019t accept walk-ins and your maid needs to show her Al-Hosn App. Thank you.&quot;",
        "question": "Maid took first dose in Dubai - wants to take the second in Dubai"
    },
    {
        "answer": "Note: Always offer a temporary replacement if the maid is sick and needs a leave:Canned: Sorry to hear that @client name@ please use your maids.cc app and find \u201cReplace @maid\u2019s name@ now\u201d and select \u201cshe\u2019s sick\u201d from the replacement menu, and we\u2019ll notify you as soon as she\u2019s fit to work again.If a client replaced a maid because she\u2019s sick and wants her backCanned: Check the maid\u2019s ERP page to see if her sick leave has ended. If so then check the SMS log to see if the client received anything about their maids returning and if they did then copy the SMS from ERP and send it again.If the maid\u2019s sick leave didn\u2019t end:Canned: @maids name@ is still on sick leave, she is expected to feel better on @date@. If she\u2019s still not feeling well by then, her sick leave may be extended. We\u2019ll notify you as soon as she\u2019s feeling better @client name@(we don\u2019t have any further info if the client asks)Canned: Sorry,\u00a0@maid\u2019s name@ is still under medical assessment. We\u2019ll notify you as soon as she\u2019s feeling better @client name@.",
        "question": "Replacement Reason - Maid is Sick - Getting Old/Original Maid back"
