        "answer": "Canned: Ms. X has to wait for 6 months of her insurance starting date in case she needs surgery or hasany chronic condition, but she can still visit and use her insurance for any normal check-up since shealready has active insurance.Cases where the maid will be covered without waiting 6 months.if the maid had an advanced chronic conditions that is life threatening and she needs to visit the hospital ASAP, or have a scheduled surgery, it will be covered without waiting 6 months.If the maid provided a \u201ccertificate of continuity\u201d document from her previous insuranceshowing that the date between previous and new insurance is less than 1 month (30 days), she will becovered without waiting for 6 months.",
