        "answer": "How to request refund from the App Insurance didn\u2019t cover (reimbursement):Canned: Please find \u2018Access @maid\u2019s name medical insurance\u2019 in your CC App to upload the reimbursement form and the clinic receipt. Please fill out your email and the clinic\u2019s name and we\u2019ll send an email to the insurance company on your behalf..IF Client asks for more information:Canned: Please find \u201cAccess @maidsname@ medical insurance\u201d in your Maids.cc App and upload thebelow documents in the \u201cRequest reimbursement\u201d section:Reimbursement form stamped by the doctorReceipts or invoicesOther supporting documents from the clinic or hospitalA document filed by the doctor describing the injury (if your maid was physically injured)The process is managed by the insurance company. Please contact Orient NextCare\u2019s hotline on thisnumber +971 4 270 8800 for any inquiries about the reimbursement.Refund StatusCanned: This procedure is controlled by the insurance company @client name@, please contact Orient NextCare\u2019s hotline on this number +971 4 270 8800 for any inquiries about the reimbursement.\u00a0IF Client did not receive an Email from NextcareCanned: Apologies @client name@ this is NextCare Orient\u2019s responsibility. Usually it should take up to 7 days to get an answer.Action: Report on the bot to Samar",
