    {
        "answer": "Notes: If the client has an Ethiopian, African or Indian maid and he wants to change to Filipino or Indonesian, he will be offered a 15 day trial period. This means we will wait for 15 days before we charge him the difference between both nationalities based on the sale price of the new nationalitythis period is free only if he goes back to the original nationality during these 15 days.if the client has an Ethiopian maid and he took a Filipino for 10 days only then switches back to African, in this case, we will not charge him extra for the 10 days he spent with the Filipino nationality.we can say it is a free trial period he tried the new nationality but was not satisfied, so we allowed him to go back to the same group with no extra charge.if he stays with the new nationality we will charge him the difference starting the day he replaced to Filipino (15 day trial period is included)Examples: Client has an Ethiopian maid paying 3095 till the 7th of Oct and on the 7th he replaced her with a Filipino maid.Here we have two scenarios:First Scenario: On the 21st, Client profile shows he has Ethiopian again.we will disregard the replacement that happened and we will not charge him anything for the days spent with the more expensive nationality during the trial periodSecond Scenario: On the 21st, Client profile shows he has Filipino, then the below change will be applied to his payment:We will charge him a one-time payment for the difference between the two nationalities for:Oct 2001 25/31 = 1614 DDA dated todayFilipino rate- Ethiopian rate + difference for OCT (from the 7th to the 31st) 2001 + 1614 =3615His future payments will be 5096 from DecemberIf the client has an Ethiopian maid paying 3095 till the 20th of Oct and on the 20th of Oct he replaces her with a Filipino maid. On the 3rd of Nov his trial period endswe have two scenarios:On the 3rd of Nov we check his profile and find out that he is with an Ethiopian maid then nothing will change for him, ERP will disregard all the changes done in the trial period and consider the client as if he did not upgrade. In other words, we will not charge him extra at all, his payments will remain the same.\u00a0On the 3rd of Nov we will check his profile and if we find out that he is with a Filipino maid. Here we should note that on the 1st of Nov we already charged him the usual Ethiopian rate so his payment will be:One Time payment for the difference between the two nationalities for this month and for the prorate of the previous month (Filipino rate- Ethiopian rate ) + (difference of previous month prorated)(5096-3095) + (5096-3095) * 13/ 31(2001) + (839)= 2840Monthly payment of 5096 Dec onward.",
        "question": "Switching Nationality - Upgrading"
    },
