        "answer": "We can check to assist clients with taking their sick maids to hospitals/clinics IF they ask for it and the management approves. It won\u2019t be offered from our side to all clients.Areas covered: Dubai, Sharjah, and Ajman (Abu Dhabi will be for escalated cases only)Case 1: the client complains to us over the chat the maid is sick.\u00a0Action: send him the company\u2019s doctor\u2019s WhatsApp number.\u00a0Check the following page:  Company Doctor - Can't Access Yaya AppCase 2: The client refused and said that the maid is very sick and needed a physical check-up.\u00a0Action: ask the client to check the nearest covered clinic using the app.\u00a0Check the following page: How to Get/ Access Medical insurance - Clinics Location on the AppCase 3: the client refused to send her to a clinic.\u00a0Action: advise the client to send her to our accommodation and the medical team there will take care of the maid.\u00a0Canned: I totally understand the situation, you can send the maid to our accommodation and our medical team will be glad to assist her, please use your maids.cc app and find \u201cReplace @maid\u2019s name@ now\u201d and select \u201cshe\u2019s sick\u201d from the replacement menu, and we\u2019ll notify you as soon as she\u2019s fit to work again.Case 4: the client is not being able to take the maid to the clinic. We can offer to the client to send the maid with a taxi and we will reimburse the taxi rides from his house. Canned: We\u2019d be happy to cover the cost of your maid\u2019s ride to the clinic. Please help her book taxis to the clinic and back to your home and send us the receipts so we can refund you the amounts.\u00a0Case 5: the client refused and he wants us to send someone to accompany the maid to the clinic or hospital since he can\u2019t do it.Action:  Confirm with the client when the maid can go to the clinic/ accommodation and check with Supervisors if we can send someone to help the maid. Canned: I will check if we can assist you, Mr. @client name @ May I ask you when you would like to send the maid to the clinic, please?\u00a0Note:  Availability of sending someone will be from 8 am to 6 pm using the following windows8 am to 10 am10 am to 12 pm12 pm to 2 pm2 pm to 4 pm4 pm to 6 pm Once the client confirms the time:\u00a0Resolvers add a brief of the situation and transfer the chat to the supervisorSupervisors will add a complaint to the medical manager, Eve, on ERP to get approval.If approved, the Resolvers will send this canned response to the client:\u00a0Canned: Our Nurse Assistant will arrive at your house, Mr. @client@ between @time@, May I ask you if this is your current address @ address@?Also, could you please make sure she has enough money for the clinic visit about AED 300? We\u2019ll be calling your maid on the following number: @maid\u2019s number@, if she has a different one, please let us know.Note: If the client refused to give money to the maid, we can pay for the maid. After the client\u2019s response: Resolvers will inform supervisors to update the complaint on ERP and transfer it to the medical team manager.Medical team manager will assign someone from her team and request a taxi for herMedical team agent will contact the maid and ask her to meet him in front of the client's house to proceed to the clinicWhen done, the agent will request a taxi from Logistics and they will either bookA taxi for the maid from the clinic to the client's house and another one for her to the office (if the client's house is not on the way to the accommodationORTaxi for them both to drop the maid at the client's house and proceed to the accommodation if the client's house is on the way to the accommodation",
