t to have your maid stay at a different accommodation while you\u2019re away.2.4. If the client refused the 25% offer:Canned: Sorry @client name@ This is the best offer we can do.Note: At any stage during the discussion, if the client threatened to cancel, we can transfer to Retention to handle it.",
