    "answer": "Canned: All our maids are provided with 2 uniforms, since your maid is a live-in we ask you to kindly provide her with food and basic toiletries.Case 1: Inquiring further about toiletries:Canned: Sure @client name, your maid\u2019s needs are basic toiletries like shampoo, soap, and toothpaste. Overall it shouldn\u2019t exceed AED 100 per month. Notes:If it is a clear question about toiletries - answer it.If he has more than one question, transfer to RBs.Case 2: Inquiring further about Uniforms - requesting additional uniforms:Whenever a client reaches us for a uniform, regardless if we already provided uniforms or not, we can provide it for free.2.1. Confirm the maid\u2019s size with the client:Canned: Sure @client name@. May I please know your maid\u2019s size? Also, would you be needing one uniform or more?2.2. After answering the above - confirm the address with the client:Canned: Thank you! Would you please confirm that this is the address that we should deliver the uniform to @client address@2.3. After the client confirms:Canned: I\u2019ll submit your request right away and then we\u2019ll deliver the uniform to your home. Thank you very much.Action: Transfer to supervisors, so they can add a complaint for accommodation receptionistsAccommodation receptionists will take a few minutes only to prepare the requested uniform. They will also book the Careem box from their end.Resolvers need to share the Careem box link with the client once generated.\u00a0",
    "question": "Uniforms and Toiletries"
