{
    "answer": "Note: We can\u2019t check if the maid is willing to stay home,\u00a0Canned: Our data shows that going out on their day off is very important to maids. But there are many maids who enjoy staying home most of the time and just go out once or twice a month for a few hours. We leave this for you to discuss with the maid you choose. Some maids even accept to get paid in return for staying in on their day off.Note: If the Client  insists on her saying home\u00a0RBs should handle\u00a0Canned: For any problems related to your maid's performance, please call our dedicated Relationship Builders team by clicking on the following link: https://www.maids.cc/call_us ",
