{
    "answer": "Note: Check if the maid is entitled for vacation (she finished her 2 years contract with us).\u00a0 If she\u2019s entitled and her vacation is already confirmed by her team and added to her page\u00a0follow below cases.Case 1: If the vacation is within a week and the client is asking to replace.Action: Direct to RBsCanned:  Our Relationship Builders team can help you with your request. Could you please call them at:\u00a0 https://www.maids.cc/call_us ? They would be more than happy to help you.Case 2: If the vacation is still not confirmed and it\u2019s still far more than a week or the client wants to discuss and have more information\u00a0Canned : Your maid still has not confirmed the date of her vacation. Once she does, we\u2019ll notify you 7 days before her vacation start date so you can replace her.Case C : If the maid is not due to vacation yet ( didn\u2019t finish her 2 years contract with us yet) and the client is fighting to send her on vacation.Canned: It looks like your maid\u2019s vacation is still not due yet Mr. John. Your maid gets 30 days of vacation after she finishes her contract with us. Once we renew her visa, she\u2019ll have 3 months to take her vacation, else we would add it to her final settlement.Case D: If the client is asking can I give my maid vacation now and I\u2019ll cover her flight ticket.Canned: Sure Mr. client, I just want to remind you that your contract will stay active and your monthly payments will be deducted normally with no refunds. Also, since you\u2019re giving your maid an unofficial vacation, you won\u2019t be able to get a replacement maid while your maid is on vacation.",
