},
{
    "answer": "Note: we usually face this case when the client is travelling on specific day next month and want the maid to stay with him till the last day. Ex: Client has monthly contract with Filipino paying 4150 per month and decided to cancel because he\u2019ll be travelling on the 6th of next month\u00a0Canned: As much as we'd love to have you for an additional week, but the agreement is monthly and we don't have a partial refund policy as mentioned in the monthly receipt that you receive.If the client insists to use the service for 1 additional week or asks to cancel his current contract and sign another weekly to keep the maid for 1 additional week.Action: Tell the client you\u2019ll check and update him within 15 minutes with approval, no manager approval is needed.Canned: Thank you for waiting Mr./Ms. @client name@ We got the approval to charge you for the weeks that you'll use and refund the remaining amount. Please note that the weekly service will be @amount@ per week. We'll deduct the full monthly payment on the first of next month and refund you the rest once you cancel the service and once the maid returns to our accommodation. The refund usually takes 5-7 working days.Note : Weekly service is 1274 for Filipino and Indonesian ,1220 for other nationalities\u00a0",
